import { GET_USER_DATA } from './actionTypes'
import CryptoJS from 'crypto-js';

export default function getDataUser() {
    return async dispatch => {  
        const secret = localStorage.getItem("secret");
        const token = localStorage.getItem("token")
        const IP = localStorage.getItem("IP");

        const ciphertextTOKEN = CryptoJS.AES.encrypt(token, secret).toString();
        console.log(IP)

        let url = 'http://localhost:8888/getUserData'

        const authData = {
            "IP": IP,
            "token": ciphertextTOKEN 
        }
        let body = JSON.stringify(authData);

        axios({
        method: 'post',
        url: url,
        data: body,
        }).then((response) => {
            console.log(response);

            dispatch(getSuccess(JSON.parse(response.data)))

        })
        .catch(function (error) {
            console.log(error);
        });
    }
}

export function getSuccess(id, email) {
    console.log("getSuccess")
    return {
        type: GET_USER_DATA,
        id,
        email

    }
}
